import React from 'react';
import { Route,Switch } from 'react-router-dom';
import Contact from './Contact';
import About from './About';


export const Home = () => {
    return (
        <>
           <h1>Hii Guys, I'm Home</h1>
           <About />
           <Contact />

           <hr /><hr /> 
        </>
    )
}

export default Home;
